// (c) Kallol Borah, 2020
// Sets up account and manages custody

pragma solidity 0.5.7;

import "./interfaces/VerifiedKYC.sol";
import "./interfaces/VerifiedClient.sol";
import "@openzeppelin/upgrades/contracts/Initializable.sol";

contract Client is VerifiedClient, Initializable{

    struct access{
        string messagingToken;
        address manager;
        bool aml;      
    }

    struct role{
        address manager;
        bytes32 country;
        bytes32 role;
        bytes32 id;
    }

    //mapping of a manager to its sub managers
    mapping(address=> role) private roles;

    //storing submanagers
    address[] submanagers;

    //submanager index
    mapping(address => uint256) private managerIndex;

    //mapping of a client to info
    mapping(address=> access) private info;

    //mapping of a client to its custody account
    mapping(address => bytes32) private custody;

    //mapping of a manager to its clients
    mapping(address => address[]) private clients;

    //client index : manager to client to index position
    mapping(address => mapping(address => uint256)) private clientIndex;

    //kyc contract
    VerifiedKYC private Kyc;

    //aml manager
    address private amlManager;

    //event for managers
    event ManagerAdded(address indexed manager, bytes32 role, bytes32 country, bytes32 managerId);

    //owner is someone who can upgrade this contract
    function initialize(address _kyc) public {
        Kyc = VerifiedKYC(_kyc);
        amlManager = msg.sender;
    }

    function getAMLManager() external view returns(address) {
        return amlManager;
    }

    //only the user or its manager can set the custody account address
    function setCustody(address _client, bytes32 _account) external {
        require(_client==msg.sender || info[_client].manager==msg.sender || msg.sender==amlManager);
        if(Kyc.getStatus(_client)==3){
            custody[_client] = _account;
        }
    }

    //only the user or its manager can get the custody account address
    function getCustody(address _client) external view returns(bytes32){
        require(_client==msg.sender || info[_client].manager==msg.sender || msg.sender==amlManager);
        if(Kyc.getStatus(_client)==3){
            return custody[_client];
        }
    }

    //access info can only be set by user
    function setAccess(string calldata _messagingToken) external{
        info[msg.sender].messagingToken=_messagingToken;
    }

    //access data for a user can only be retrieved by itself or its manager
    function getAccess(address _client) external view returns(string memory){
        require(_client==msg.sender || info[_client].manager==msg.sender);
        return (info[_client].messagingToken);
    }

    //when a user is not registered, the AML manager can set the user's KYC manager
    //when a user is registered or KYC passed, both the AML manager and KYC manager can reset the user's manager
    function setManager(address _client, address _manager) external{
        bool found = false;
        if(amlManager==msg.sender && _client!=_manager){
            if(info[_client].manager!=_manager){
                if(info[_client].manager!=address(0x0)){
                    address currentManager = info[_client].manager;
                    for(uint j=0; j<clients[currentManager].length; j++){
                        if(clients[currentManager][j]==_client){
                            if(j==clients[currentManager].length-1)
                                delete clients[currentManager][j];
                            else
                                clients[currentManager][j]=clients[currentManager][j+1];
                        }
                    }
                }
                info[_client].manager = _manager;
                if(clientIndex[_manager][_client]>0)
                    found = true;
                if(!found){
                    clients[_manager].push(_client);
                    clientIndex[_manager][_client] = clients[_manager].length;
                }
            }
        }
        else if(info[_client].manager==msg.sender && _client!=_manager){
            if(info[_client].manager!=_manager){
                if(info[_client].manager!=address(0x0)){
                    address currentManager = info[_client].manager;
                    for(uint j=0; j<clients[currentManager].length; j++){
                        if(clients[currentManager][j]==_client){
                            if(j==clients[currentManager].length-1)
                                delete clients[currentManager][j];
                            else
                                clients[currentManager][j]=clients[currentManager][j+1];
                        }
                    }
                }
                info[_client].manager = _manager;
                if(clientIndex[_manager][_client]>0)
                    found = true;
                if(!found){
                    clients[_manager].push(_client);
                    clientIndex[_manager][_client] = clients[_manager].length;
                }
            }
        }
    }

    // manager identity can be retrieved by user or its manager only
    function getManager(address _client) external view returns(address){
        return info[_client].manager;
    }

    //checks if client is registered or not
    function isRegistered(address _client) external view returns(bool){
        if(info[_client].manager!=address(0x0))
            return true;
        else
            return false;
    }

    //sets AML status
    function setAMLStatus(address _client, bool status) external {
        require(msg.sender==info[_client].manager || msg.sender==amlManager);  
        info[_client].aml = status;
    }

    //gets AML status
    function getAMLStatus(address _client) external view returns(bool){
        require(msg.sender==info[_client].manager || msg.sender==amlManager);  
        return info[_client].aml;
    }

    //get clients for specified manager with registration status set to true or false
    function getClients(address _manager) external view returns(address[] memory){
        require(msg.sender==_manager);
        return getClientsForManager(_manager);
    }

    function getClientsForManager(address _manager) private view returns(address[] memory){
        return clients[_manager];
    }

    //add role
    function addRole(address _submanager, bytes32 _country, bytes32 _role, bytes32 _id) external{
        require(_role=="Custodian" || _role=="Issuer" || _role=="DP" || _role=="KYCAML");
        require(getClientsForManager(msg.sender).length>0);
        submanagers.push(_submanager);
        managerIndex[_submanager] = submanagers.length;
        roles[_submanager].manager = msg.sender;
        roles[_submanager].country = _country;
        roles[_submanager].role = _role;
        roles[_submanager].id = _id;
        emit ManagerAdded(_submanager, _role, _country, _id);
    }

    //get roles for manager
    function getRole(address _user) external view returns(bytes32, bytes32){
        uint256 position = managerIndex[_user];
        if(position>0){
            if(submanagers[position-1]==_user){
                return (roles[submanagers[position-1]].role, roles[submanagers[position-1]].id);
            }
        }
        if(_user==amlManager)
            return ("KYCAML","");
        else
            return ("","");
    }

    //remove role
    function removeRole(address _submanager, bytes32 _country, bytes32 _role) external{
        require(_role=="Custodian" || _role=="Issuer" || _role=="DP" || _role=="KYCAML");
        uint256 position = managerIndex[_submanager];
        if(position>0){
            if( submanagers[position-1]==_submanager &&
                roles[submanagers[position-1]].role==_role && 
                roles[submanagers[position-1]].country==_country &&
                roles[submanagers[position-1]].manager==msg.sender){
                delete(roles[submanagers[position-1]]);
            }
        }
    }

    function getManagers(bytes32 _role, bytes32 _country) external view returns(address[] memory){
        require(_role=="Custodian" || _role=="Issuer" || _role=="DP" || _role=="KYCAML");
        address[] memory resp = new address[](submanagers.length);
        uint j = 0;
        for(uint i=0; i<submanagers.length; i++){
            if(roles[submanagers[i]].role==_role && roles[submanagers[i]].country==_country){
                resp[j] = submanagers[i];
                j = j+1;
            }
        }
        return resp;
    }   

}
